struct BigInt{int ai[210],len;};
BigInt operator + (const BigInt &a,const  BigInt &b){
	BigInt c;
	c.len=0;
	int i,x,jin=0;
	for(i=0;i<max(a.len,b.len);i++){
		x=jin;
		if(i<a.len)x+=a.ai[i];
		if(i<b.len)x+=b.ai[i];
		c.ai[c.len++]=(x%10);
		jin=x/10;
	}
	while(jin){c.ai[c.len++]=(jin%10);jin/=10;}
	return c;
}
bool operator < (const BigInt &a,const BigInt &b){
	if(a.len<b.len)return true;
	if(a.len>b.len)return false;
	int i;
	for(i=a.len-1;i>=0;i--){
		if(a.ai[i]<b.ai[i])return true;
		if(a.ai[i]>b.ai[i])return false;
	}
	return false;
}
bool operator == (const BigInt &a,const BigInt &b){
	if(a.len!=b.len)return false;
	int i;
	for(i=a.len-1;i>=0;i--)
		if(a.ai[i]!=b.ai[i])return false;
	return true;
}
BigInt div(const BigInt &a){
	BigInt c;
	c.len=0;
	int i;
	for(i=0;i<a.len;i++){
		c.ai[c.len++]=(a.ai[i]/2);
		if((a.ai[i]&1)&&i){
			c.ai[i-1]+=5;
		}
	}
	while(c.len&&!c.ai[c.len-1])c.len--;
	return c;
}
void givev(BigInt &a,int x){
	a.len=0;
	while(x){a.ai[a.len++]=(x%10);x/=10;}
}
void print(BigInt &a){
	if(a.len==0)printf("0");
	int i;
	for(i=a.len-1;i>=0;i--)
	printf("%d",a.ai[i]);
	printf("\n");
}
bool check(BigInt a){
	BigInt b,c,s;
	b=a;
	givev(c,0);
	givev(s,1);
	while(a.len){
		if(c==b)return true;
		if(b<c)return false;
		if(a.ai[0]&1)c=c+s;
		s.ai[s.len-1]=0;
		s.ai[s.len++]=1;
		a=div(a);
	}
	if(c==b)return true;
	return false;
}

